    id: 0,
    name: 'ルーム番号',
    room: []
}

const testReducer = (state = initialState, action) => {
    console.log(state)
    switch (action.type) {
        case CREATE_ROOM:
            const newRoom = (<div>{state.name}{state.id}</div>)
            console.log(newRoom)
            // state.room = newRoom;
            // state.id++;
            return newRoom;
        default:
            return [state.id, state.name, state.room];
    }
}

export default testReducer;
